--
-- Name: registration; Type: VIEW; Schema: logs; Owner: -
--

CREATE VIEW logs.registration AS
 SELECT r.created_date AS registration_date,
    r.name,
    r.nik,
    c.created_date AS approved_date,
    c.customer_id,
    r.email,
    r.phone_number,
    r.gender,
    c.religion,
    r.home_address AS alamat_ktp,
    r.neighbourhood_number AS rt,
    r.hamlet_number AS rw,
    r.sub_district AS kel_desa,
    r.urban_village AS kecamatan,
    r.zip_code,
    r.city AS kota,
    r.province AS provinsi,
    c.mother_name,
    c.npwp,
    c.relative_name,
    c.relative_phone_number,
    r.birth_date AS tanggal_lahir,
    r.place_of_birth AS tempat_lahir,
    c.last_education,
    ce.source_income,
    ce.work_type,
    ce.company_name,
    ce.industrial_company,
    ce.monthly_income,
    pd.maritalstatus,
    ra.utm_source,
    ra.utm_medium,
    ra.utm_campaign,
    ra.register_by_google,
        CASE
            WHEN (r.product_id = 1) THEN 'Flex'::text
            WHEN (r.product_id IS NOT NULL) THEN 'Max'::text
            ELSE NULL::text
        END AS product_type,
    r.amount,
        CASE
            WHEN (r.product_id = 1) THEN COALESCE(r.period_in_month, 0)
            ELSE r.period_in_month
        END AS period,
        CASE
            WHEN (r.confirmed = true) THEN 'Verified'::text
            WHEN (r.confirmed = false) THEN 'Not Verified'::text
            ELSE NULL::text
        END AS status_register,
        CASE
            WHEN (r.verified = true) THEN 'Verified'::text
            WHEN (r.verified = false) THEN 'Not Verified'::text
            ELSE NULL::text
        END AS verified_otp
   FROM ((((registrants.regs r
     LEFT JOIN customers.customers c ON ((r.regs_id = c.regs_id)))
     LEFT JOIN customers.customers_emp_data ce ON (((c.customer_id)::text = (ce.customer_id)::text)))
     LEFT JOIN dukcapil.personal_data pd ON (((r.nik)::text = (pd.ktpnumber)::text)))
     LEFT JOIN registrants.regs_additional_data ra ON ((r.regs_id = ra.regs_id)));


